import React from "react";

const Table = ({ tableMetaData, personData }) => {
  return (
    <div className="mt-5">
      <table className="table">
        <thead>
          <tr>
            {tableMetaData.map((x, i) => (
              <th key={i} scope="col">
                {x.headerTitle}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {personData.map((rowData, index) => (
            <tr key={index}>
              {/* <th scope="row">1</th> */}
              {tableMetaData.map((meta, j) => (
                <td key={j}>{meta.render(rowData)}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Table;
